import Cover from '../../graphics/imageCover/Cover'
import Text from '../../graphics/textDisplayer/Text'

export default function AlphaDisplayer({style, image, title, description, buttonText, clickAction}) {
    return (
        <div className={style}>
            <Cover image={image} height="h-full" style="flex flex-col justify-center items-center w-full h-full">
                <Text text={title} style="m-2" textStyle="text-white text-xl font-bold"/>
                <Text text={description} style="m-1" textStyle="text-white"/>
                <button className="bg-white text-gray-900">{buttonText}</button>
            </Cover>
        </div>
    )
}
